import React from "react";
import { Input, Space } from 'antd';
const { Search } = Input;
function App() {
  const onSearch = value => console.log(value);
  return (
    <>
    <div><img style={{marginLeft:"auto",marginRight:"auto",marginTop:"30px",display:"block"}} src="itunes.svg"></img></div>
    <div style={{marginLeft:"auto",marginRight:"auto",display:"block"}}>
     <Search placeholder="Search Songs" style={{width:"350px"}} onSearch={onSearch} enterButton />
    </div>
    </>
  );
}

export default App;
